export default (function(a,b,c,d){return {data:{hI1ThmWo7Y:{data:{id:877,attributes:{imdbId:"tt4054654",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTc0ODExNjM4NV5BMl5BanBnXkFtZTgwNzY4ODYxMDI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"4.7\u002F10"},{Source:"Rotten Tomatoes",Value:"49%"},{Source:"Metacritic",Value:"53\u002F100"}],item_lang:{data:{id:1540,attributes:{title:b,plot:"Carved from a lifetime of experience that runs the gamut from incarceration to liberation, Dog Eat Dog is the story of three men who are all out of prison and now have the task of adapting themselves to civilian life. The California three strikes law looms over them, but what the hell, they're going to do it, and they're going to do it their way. Troy, an aloof mastermind, seeks an uncomplicated, clean life but cannot get away from his hatred for the system. Diesel is on the mob's payroll and his interest in his suburban home and his nagging wife is waning. The loose cannon of the trio, Mad Dog, is possessed by true demons within, which lead him from one situation to the next. One more hit, one more jackpot, and they'll all be satisfied. Troy constructs the perfect crime and they pull it off, but in the aftermath, they keep finding the law surrounding them wherever they go.",slug:"dog-eat-dog"}}},books:{data:[{id:5354,attributes:{title:b,description:"Under the new California \"three strikes\" law, three ex-convicts attempt to live normal lives, but when they find it impossible to do so, they devise a plan to do one more collaborative job that will either land them in prison or put them on easy-street for the rest of their lives",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=45FF2QX3bLwC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"1997-08-15",publisher:"Macmillan",subtitle:"A Novel"}},{id:5355,attributes:{title:"Schwerer Seeunfall Kollision zwischen Fähre Laboe und Segelyacht Røde Orm am 21. Juni 2008 auf der Kieler Förde",description:a,thumbnail:a,authors:[c],firstBook:d,published:"2009-01-01",publisher:a,subtitle:"16. März 2009"}},{id:5356,attributes:{title:"Edward Bunker Omnibus",description:"This collection is comprised of three of Bunker's most popular and gripping novels. Dog Eat Dog is the tale of three unremorseful criminals with two felony convictions apiece and no more chances. Little Boy Blue recounts the story of young Alex Hamilton, an intelligent and independent soul, but given to sudden fits of violent rage. The Animal Factory, recently released as a feature film in England starring Edward Furlong and Willem Dafoe, tells the story of Ronald Decker who, put in jail for a minor offence, is befriended by old lag', Earl Copen. Each novel sees Bunker at his best.'",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=pLvTAQAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2004-02-01",publisher:a,subtitle:"Dog Eat Dog, Little Boy Blue and the Animal Factory"}},{id:5357,attributes:{title:b,description:a,thumbnail:a,authors:["Edward Bunker Staff"],firstBook:d,published:"1000-01-01",publisher:a,subtitle:a}},{id:5358,attributes:{title:"Little Boy Blue",description:"\"Dog Eat Dog,\" Bunker's fourth novel, follows Troy Cameron, a reformatory graduate like Bunker. A terrifying and brutal narrative, the novel tracks his lawless spree in the company of two other reform school alumni, Diesel Carson and Mad Dog Cain. \"Dog Eat Dog\" is a novel of excruciating authenticity, with great moral and social resonance, and it could only have been written by Edward Bunker, who has been there.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=vxQuAAAACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"2000-01-01",publisher:a,subtitle:b}}]}}},meta:{}}},prerenderedAt:1680940958687}}("","Dog Eat Dog","Edward Bunker",null))